import axios from 'axios';

function Try(props) {
    const [products, setProducts] = useState([]);
    useEffect(() => {
      axios.get("http://dataservice.accuweather.com/locations/v1/cities/autocomplete?apikey=uhtrRSo6CDxLgAFlBtnEZh2wWkRANgZf&q=Je&language=en-us")
        .then((data) => {
          setProducts(data.data);
          debugger;
        })
    }, []);
    
    return (
      <div>
        <h1>bvb</h1>
        { console.log(products), products.map(p, index => {p.Key}) }
        </div>

    )
  }
  export default Try;
